feature.on('click',e=>{
sound.stop()
sound.play()
})

let gui = feature.createBasicGui()
feature.on('click', e => {
    gui.addText('Oddly , this is familiar to you, as if it were from an old dream, but
you can't exactly remember...')
    gui.show()
    setTimeout(() => {
        gui.destroy()
    }, 5000)
})

let closed = true

feature.on('click',e=>{

  if(closed){
      feature.rotation.y=0
  }else{
      feature.rotation.y=1.57

  }
closed=!closed
})

let hihat = parcel.getFeatureById('hihat')
let crash = parcel.getFeatureById('crash')
let hitom = parcel.getFeatureById('hitom')
let kick = parcel.getFeatureById('kick')
let cowbell = parcel.getFeatureById('cowbell')
let snare = parcel.getFeatureById('snare')

feature.on('keys', e => {
    if (e.keys.left) {
        hitom.stop()
        hitom.play()
    } else if (e.keys.right) {
        snare.stop()
        snare.play()
    } else if (e.keys.up) {
        cowbell.stop()
        cowbell.play()
    } else if (e.keys.down) {
        kick.stop()
        kick.play()
    } else if (e.keys.a) {
        hihat.stop()
        hihat.play()
    } else if (e.keys.b) {
        crash.stop()
        crash.play()
    } 
})

